import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Chat from "./Chat";
import Login from "./Login.js";
import Register from "./Register";
function App() {
  return (
    <Router>
      <div className="container-sm">
        <Routes>
          <Route path="/">
            <Login />
          </Route>
        </Routes>
        <Routes>
          <Route path="/reg">
            <Register />
          </Route>
        </Routes>
        <Routes>
          <Route path="/chat">
            <Chat />
          </Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
